import React from 'react';
import "./join.css"

const Join = () => {
    return (
        <div className='join' id="join-us">
          <div className='left-join'>
            <div>
                <span className='stroke-text'>READY TO</span>
                <span> LEVEL UP</span>
            </div>
            <div>
            <span className='stroke-text'>YOUR BODY</span>
            <span> WITH US ?</span>
        </div>
          </div>
          <div className='right-join'></div>  
        </div>
    );
};

export default Join;
